// src/pages/join/ContactAcknowledgement.js
import React from "react";
import { useLocation, NavLink } from "react-router-dom";

export default function ContactAcknowledgement() {
  const { state } = useLocation();
  const type = state?.type || "Request";

  return (
    <section className="section-container">
      <h1 className="section-title">Thank You</h1>
      <p className="lead">
        Your {type.toLowerCase()} has been received. Our team will contact you shortly with next steps.
      </p>
      <NavLink to="/" className="btn-primary">Back to Home</NavLink>
    </section>
  );
}
